import styled from 'styled-components'

export const Footers = styled.footer`
 position: relative;
 bottom: 0;
 width: 100%;
 height: 50px;
 p {
     color: #fff;
     text-align: center;
     margin-top: 10px;
 }
`;

export const Forms = styled.form`
 position: fixed;
 bottom: 10px;
 width: 100%;
 height: 50px;

`;
